import React from "react";
import { MainContainer } from "./styles/Main.styled";

export default function Main(props) {
  const { data } = props;
  return (
    <div className="NASA-section">
      {data !== null ? <img className="APODImg" src={data.url}></img> : null}
      <div className="NASA-texts">
        <h2>{data.title}</h2>
        <p>{data.copyright}</p>
        <p>{data.date}</p>
        <p>{data.explanation}</p>
      </div>
    </div>
  );
}
